export enum BookType {
    FICTION = 'FICTION',
    NON_FICTION = 'NON_FICTION',
    POETRY='poetry',
    DRAMA='drama',
    FANTASTIC='fantastic',
    ACADEMIC='academic'

}

export interface Book {
    id: string;
  name: string;
  bookType:BookType;
  description: string;
  price: number;
  quantity: number;

}
